  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  executive summary was written to guide management on Quivira National Wildlife Refuge
  for the next 15 years. This plan outlines the Refuge vision and purpose and describes
  how the Refuge will contribute to the overall mission of the Refuge System. The
  plan provides an introduction to the Refuge, an overview of the CCP planning process,
  a summary of Refuge resources, goals and objectives, information about the management
  direction, a description of the affected environment, and a description of Refuge
  biology and habitats.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
